import React from "react";
import { createStackNavigator } from "@react-navigation/stack";

import FoodDye from "../screens/FoodDye";
import Preservatives from "../screens/Preservatives";
import Sugars from "../screens/Sugars";
import Vitamins from "../screens/Vitamins";
import Home from "../screens/Home";

const Stack = createStackNavigator();

const HomeNavigator = () => (
  <Stack.Navigator>
    <Stack.Screen
	  name="Home"
      component={Home}
      options={{ title: "Home" }}
	/>
    <Stack.Screen
	  name="FoodDye"
      component={FoodDye}
      options={{ title: "List of Food Dyes" }}
	/>
    <Stack.Screen
	  name="Preservatives"
      component={Preservatives}
      options={{ title: "List of Preservatives" }}
	/>
  <Stack.Screen
	  name="Sugars"
      component={Sugars}
      options={{ title: "List of Sugars" }}
	/>
  <Stack.Screen
	  name="Vitamins"
      component={Vitamins}
      options={{ title: "List of Vitamins" }}
	/>
    
  </Stack.Navigator>
);

export default HomeNavigator;
